import './App.css';
import Counter from './components/Counter';
import { createBrowserRouter, RouterProvider } from "react-router-dom";
import RootPage from './pages/RootPage';
import HomePage from './pages/HomePage';
import Campionati from './pages/Campionati';
import Squadre from './pages/Squadre';
import Calciatori from './pages/Calciatori';
import Contatti from './pages/Contatti';
import ErrorPage from './pages/ErrorPage';


const router = createBrowserRouter([

  {path: '', element: <RootPage></RootPage>, errorElement: <ErrorPage></ErrorPage>,
  children:[
  {index: true, element: <HomePage></HomePage>},

  // {path: 'squadre', element: <Squadre></Squadre>,
  // children: [
  // {index: true, element: <Total-Team></Total-Team>,loader: teamLoader},
  // {path: ':idTeam', id:'team-detail', loader: detailTeamLoader,
  // children:[
  // {index: true, element: <DetailTeam></DetailTeam>}  
  // ]}
  // ]},

  {path: 'campionati', element: <Campionati></Campionati>},
  {path: 'squadre', element: <Squadre></Squadre>},
  {path: 'calciatori', element: <Calciatori></Calciatori>},
  {path: 'contact', element: <Contatti></Contatti>},   

  ]},
  ]);

function App() {
  return (
    <div className="App">
      FootbalLife App
      <Counter></Counter>
      <RouterProvider>
      router = {router}  
      </RouterProvider>
    </div>
  );
}

export default App;
